// Import
import React from 'react';

const AboutUs = () => {
    return (
        <div className="about-us-container">
            <h1 className="about-us-header">About Us</h1>
            <br></br>
            <p className="about-us-description">
                Our company has been at the forefront of innovation and progress for over 100 years. Founded in 1920, we have grown to become one of the leading players in our industry, known for our commitment to excellence and our ability to adapt to the ever-changing landscape of business.
            </p>
            <p className="about-us-description">
                Our mission is to provide our customers with the highest quality products and services while maintaining the highest standards of integrity and responsibility. We strive to be a responsible corporate citizen, committed to sustainable practices and the well-being of our communities.
            </p>
            <p className="about-us-description">
                We have a diverse and talented team of employees, united by a passion for excellence and a commitment to delivering results. Our investments in research and development have led to many industry firsts, and we continue to push the boundaries of what is possible.
            </p>
            <p className="about-us-description">
                We are proud of our history and excited about our future. We look forward to continuing to serve our customers and communities with the same dedication and excellence that has been the foundation of our success for over a century.
            </p>
            <br></br>
            <br></br>
            <br></br>
        </div>
    );
};

export default AboutUs;


